import React from 'react'
import NavBar from "../components/NavBar";
import Hero from '../components/Hero';
import Footer from '../components/Footer';

function Ono ()  {
  return (
    <>
    <NavBar/>
    <Hero
      propsName="onoHero"
      heroImg="https://onomeals.zeusjones.com/images/Ono_Hero_2.jpg"
      title="Service"
      url="/"
    />
    <Footer/>
    </>
  )
}

export default Ono;
